// https://leetcode.com/problems/design-add-and-search-words-data-structure/
class WordDictionary {
public:
    struct Trie{
        bool isLeaf;
        Trie* children[26];
        Trie(){
            isLeaf = false;
            for(int i=0; i<26; i++){
                children[i] = nullptr;
            }
        }
    };
    Trie* root;
    WordDictionary() {
        root = nullptr;
    }
    
    void addWord(string word) {
        if(root == nullptr)
            root = new Trie();
        Trie* node = root;
        for(auto ch: word){
            int index = ch - 'a';
            if(node->children[index] == nullptr){
                node->children[index] = new Trie();
            }
            node = node->children[index];
        }
        node->isLeaf = true;
    }
    
    bool find(string word, int i, Trie* node){
        if(node == nullptr)
            return false;
        for(; i<word.size(); i++){
            char ch = word[i];
            if(node == nullptr)
                return false;
            if(ch == '.'){
                for(int k=0; k<26; k++){
                    if(node && node->children[k]){
                        if(find(word, i+1, node->children[k]))
                            return true;
                    }
                }
                return false;
            }else{
                int index = ch - 'a';
                if(node && node->children[index]){
                    node = node->children[index];
                }else{
                    return false;
                }
            }
        }
        return node->isLeaf;
    }
    bool search(string word) {
        Trie* node = root;
        return find(word, 0, node);
    }
};

